import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => (
  <div className="container text-center my-5">
    <h1>Walky Loving Dogs</h1>
    <p>Aplicação de Creche para Cachorros</p>

    <div className="d-flex justify-content-center gap-3 mt-4">
      <Link to="/pets" className="btn btn-primary">Ver Pets</Link>
      <Link to="/admins/novo" className="btn btn-secondary">Cadastrar Novo Admin</Link>
      <Link to="/admins" className="btn btn-info ms-2">Ver Admins</Link>
    </div>
  </div>
);

export default Home;
